  true,\n\t\"url\": null,\n\t\"notes\": \"The geographic comparability file provides
  a simple relationship between each 2010 Census county subdivision and its comparable
  Census 2000 county subdivision (if comparability exists) with an additional comments
  section to describe more detailed changes.  For the vast majority of records, there
  is a one-to-one relationship between a 2010 Census county subdivision and a Census
  2000 county subdivision, although names and codes may have changed between censuses.
  \ Where a 2010 Census record has no comparable Census 2000 county subdivision information,
  it is the result of new subdivisions being created from existing areas or the 2010
  Census county subdivisions have changed so dramatically as to preclude any comparability.\",\n\t\"license_title\":
